Defendant Jeffrey J Kais in court, in custody, with attorney Timothy T Kay.   Timothy F Westphal appeared for the State of Wisconsin.    Defendant enters a guilty plea to Count 1.  Court finds defendant guilty.  Count 2 is dismissed and read in.

The Court Orders the Following:

Imposed and Stayed Sentence of:

 5 Years 8 months Imprisonment (Credit - 0  days )  CONSECUTIVE TO ANY SENTENCE BEING SERVED
-  2 Years 8 months of Initial Confinement
-  3 Years of Extended Supervision

Term of Probation:  3 years

Conditions of Probation/Extended Supervision:
- AODA Assessment and follow through with any treatment recommended;
- Perform 10 hours of community service each year of probation;

- Absolute Sobriety; Random U.A.s;
- No Use or Possession of alcohol or illegal drugs or drug paraphernalia;
- No Use or Possession of prescription drugs without a valid prescription;
-Any valid prescription drugs must be taken in the manner in which they are prescribed;
- Inform agent of all prescriptions;
-  Sign Medical Release for Agent;
- Operate a Motor Vehicle with a Valid Drivers License;
- Obtain driver's license;
- Maintain/Obtain full time employment ;
- Provide DNA sample if not yet provided  and pay surcharge;
- No contact with Terry S, his residence or members of his family .

Restitution: $50.00 Terry S.  Court reserves ruling on remaining restitution until restitution hearing.    Atty.  Kay to remain on the case and attend the restitition hearing.  

Cost: $ 278.00
DNA surcharge: $250.00
(To to be paid as a condition of probation and paid during the first year of probation) 

Defendant is eligible for the Challenge Incarceration Program
Defendant is eligible for the Substance Abuse Program

Felony warnings, immigration warnings,  voting rights and firearms warnings given. 
  Restitution hearing scheduled for July 24, 2014 at 08:30 am.
